    event.preventDefault();
    return <p>hello</p>;
  }

  return (
    <div className="Phonetic d-flex flex-direction-row">
      <div className="audio">
        <button class="material-symbols-outlined" id="playButton">
          play_circle
        </button>
      </div>
      {props.phonetic.text}
    </div>
  );
}
